import React, { useState } from 'react';

const Baji = () => {
  const tabs = ['Overview', 'ক্রিকেট', 'লাইভ ক্যাসিনো', 'স্লট গেম', 'টেবিল গেম', 'স্পোর্টস', 'মাছ ধরা'];
  const [activeTab, setActiveTab] = useState('Overview');
  const [selectedOption, setSelectedOption] = useState("");
  const [dateInput, setDateInput] = useState("");

  const overviewColumns = [
    "তারিখ",
    "Bet Count",
    "Bet Amount",
    "জয় পরাজয়",
    "Jackpot Contribution",
    "Jackpot Amount",
  ];

  const commonColumns = [
    "তারিখ",
    "Id",
    "Bet Id",
    "Provider	",
    "Game Name",
    "Bet Amount",
    "Valid Bet",
    "Win/Loss",
    "Tip",
    "Jackpot Contribution",
    "Jackpot Amount",
  ];

  return (
    <div className="bg-informationBackground min-h-screen">
      <div className="mx-auto pt-4 bg-white max-w-6xl min-h-screen">
        
        {/* Tab buttons */}
        <div className="flex overflow-x-auto whitespace-nowrap text-xs space-x-2 items-center lg:justify-center mb-4" role="tablist">
          {tabs.map((tab, index) => (
            <button
              key={index}
              role="tab"
              aria-selected={activeTab === tab}
              className={`px-4 py-2 font-bold rounded transition-all duration-300 ease-in-out ${
                activeTab === tab ? "bg-common-blue text-white" : "bg-gray-200"
              }`}
              onClick={() => setActiveTab(tab)}
            >
              {tab === 'Overview' && (
                <div className="flex items-center">
                  {/* Custom SVG Logo */}
                  <svg
                    xmlns="http://www.w3.org/2000/svg"
                    width="20"
                    height="20"
                    viewBox="0 0 24 24"
                    fill="none"
                    stroke="white"
                    strokeWidth="3"
                    strokeLinecap="round"
                    strokeLinejoin="round"
                    className="inline-block pt-1 mr-2 md:hidden"
                  >
                    <polyline points="23 4 23 10 17 10"></polyline>
                    <path d="M20.49 15a9 9 0 1 1 2.13-9" />
                  </svg>
                  <span>{tab}</span>
                </div>
              )}
              {tab !== 'Overview' && tab}
            </button>
          ))}
        </div>

        {/* Table */}
        <div className="overflow-x-auto">
          <table className="w-full">
            <thead className="whitespace-nowrap">
              {/* Filters row */}
              <tr className="border-b border-gray-400">
                <th colSpan={commonColumns.length} className="p-2 text-left">
                  <div className="flex  space-x-4">
                    {/* Select Input */}
                    <select
                      value={selectedOption}
                      onChange={(e) => setSelectedOption(e.target.value)}
                      className="p-2 border border-gray-300 rounded"
                    >
                      <option value="">Select Option</option>
                      <option value="option1">Option 1</option>
                      <option value="option2">Option 2</option>
                    </select>
                    
                    {/* Text (h3 tag) */}
                    <h3 className="text-lg font-semibold">This is a heading text</h3>

                    {/* Date Input */}
                    <input
                      type="date"
                      value={dateInput}
                      onChange={(e) => setDateInput(e.target.value)}
                      className="p-2 border border-gray-300 rounded"
                    />
                  </div>
                </th>
              </tr>

              {/* Column headers */}
              <tr className="border-b border-gray-400">
                {(activeTab === "Overview" ? overviewColumns : commonColumns).map((col, index) => (
                  <th key={index} className="p-2 text-left">
                    {col}
                  </th>
                ))}
              </tr>
            </thead>
            <tbody>
              {/* Placeholder row for no data */}
              <tr>
                <td colSpan={activeTab === "Overview" ? overviewColumns.length : commonColumns.length} className="lg:text-center text-pretty text-gray-400">
                  কোন তথ্য নেই
                </td>
              </tr>
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default Baji;
